import React, { Component } from 'react'

import axios from 'axios'

export default class Perfil extends Component {
    state = {
        users: []
    }

    async componentDidMount() {
        const res = axios.get('http:/localhost:4000/user/1');
        this.setState({ users: res.data });
        console.log(this.state.users.data);
    }

    render() {
        return (
            <div className="container px-5">
                <div className="card bg-dark text-white">
                    <img src="https://k37.kn3.net/9E0D271BA.jpg" class="card-img" alt="..." />
                    <div className="card-img-overlay">

                        <img src={'https://laboratoriosniam.com/wp-content/uploads/2018/07/michael-dam-258165-unsplash_WEB2.jpg'} width="96" height="96" className="rounded-circle float-left mr-2 mt-2 border-2" alt="" />
                    </div>
                </div>
            </div>
        )
    }
}
